import React, { useEffect, useState } from 'react';
import personalInfo from '../personal/info.json';

const Resume = () => {
  const [info, setInfo] = useState(null);

  useEffect(() => {
    setInfo(personalInfo);
  }, []);

  if (!info) return <div>Loading...</div>;

  return (
    <div className="resume-container">
      <h1>{info.name}</h1>
      <p>{info.location}</p>
      <p>Email: {info.email}</p>
      <p>Phone: {info.phone}</p>
      <p>{info.title}</p>
      <h2>Professional Summary</h2>
      <p>{info.summary}</p>
      <h2>Core Competencies</h2>
      <ul>
        {info.competencies.map((competency, index) => (
          <li key={index}>{competency}</li>
        ))}
      </ul>
      <h2>Work Experience</h2>
      {info.experience.map((job, index) => (
        <div key={index}>
          <h3>{job.role}</h3>
          <p>{job.company}</p>
          <p>{job.duration}</p>
          <ul>
            {job.responsibilities.map((responsibility, idx) => (
              <li key={idx}>{responsibility}</li>
            ))}
          </ul>
        </div>
      ))}
      <h2>Education</h2>
      {info.education.map((edu, index) => (
        <div key={index}>
          <h3>{edu.degree}</h3>
          <p>{edu.institution}</p>
          <p>{edu.year}</p>
        </div>
      ))}
      <h2>Certifications</h2>
      {info.certifications.map((cert, index) => (
        <div key={index}>
          <h3>{cert.name}</h3>
          {cert.date && <p>Date: {cert.date}</p>}
          {cert.id && <p>Credential ID: {cert.id}</p>}
          {cert.link && (
            <p>
              <a href={cert.link} target="_blank" rel="noopener noreferrer">
                View Certification
              </a>
            </p>
          )}
        </div>
      ))}
      <h2>Personal Projects</h2>
      {info.projects.map((project, index) => (
        <div key={index}>
          <h3>{project.name}</h3>
          <p>{project.year}</p>
          <p>{project.description}</p>
        </div>
      ))}
      <h2>Languages</h2>
      <ul>
        {info.languages.map((language, index) => (
          <li key={index}>{language}</li>
        ))}
      </ul>
      <h2>Links</h2>
      <p>
        <a href={info.links.linkedin} target="_blank" rel="noopener noreferrer">
          LinkedIn Profile
        </a>
      </p>
    </div>
  );
};

export default Resume;
